import React from 'react';
import axios from "axios";

export default class ArchivePage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            archives:"",
        };
    }

    componentDidMount() {
        axios("/listarchives").then(({ data }) => {
            this.setState({
                archives: data
            });
        });
    }


    render() {
        return(
            <div>
                {this.archives !== "" &&
                <><h1>TEST</h1><script type="text/javascript">
                        for (let i = 0; i <this.archives.length />; i++) {this.archives[i].id};
                        });
                    </script></>
                }
            </div>
        )
    };
};
